class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m = len(board)
        n = len(board[0])

        all_vals = []
        for i in range(m):
            for j in range(n):
                all_vals.append((board[i][j], i, j))

        all_vals.sort(reverse=True)

        fres = float("-inf")
        for i in range(min(len(all_vals), m+n+5)):
            first_val = all_vals[i]
            for j in range(i+1, min(len(all_vals), i+m+n+5)):
                if all_vals[j][1] == first_val[1] or all_vals[j][2] == first_val[2]:
                    continue
                else:
                    second_val = all_vals[j]
                    cpred = False
                    for k in range(j+1, min(len(all_vals), j+m+n+2)):
                        if all_vals[k][1] in (first_val[1], second_val[1]) or all_vals[k][2] in (first_val[2], second_val[2]):
                            continue
                        else:
                            third_val = all_vals[k]
                            cpred = True
                            break

                    if cpred:
                        fres = max(fres, first_val[0] + second_val[0] + third_val[0])

        return fres
